import React, { Component } from 'react';
import './Home.sass';
import { Grid } from '@material-ui/core';

const styles = theme => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing.unit * 2,
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
});
class Home extends Component {

    render() {
        return (
            <div className={'Home-container'}>

            </div>
        );
    }
}
export default Home;
